import Link from 'next/link'

export default ({ team }) => (
  <div className="team-wrapper">
    {team.map(person => (
        <Link key={person.id} href={`/?q=${person.fields.name}`}>
          <a><img src={person.fields.avatar[0].url} alt={person.fields.name} className={activePartner == person.fields.name ? "img-xtra-sml padding-sml clickable person-avatar person-avatar--active" : "img-xtra-sml padding-sml clickable person-avatar"} /></a>
        </Link>
      )
    )}
  </div>
)


